import React, { Component } from 'react';
import './App.css';
import wall from 'https://unsplash.com/photos/lKbW5QTT3nQ';

class App extends Component {
    render() {
        return (
            <div className="App">
                <img src={wall} alt="wall"/>
                <h1>Mukul Mehra</h1>
                <input type="text" placeholder="Enter Any Text"></input> 
            </div>
        );
    }
}
 
export default App;
